
public class RelationalOperators {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
      int a=10, b=15;
      
      
      System.out.println("Output of a==b :" +" "+ (a==b));
      System.out.println("Output of a>b :" +" "+ (a>b));
      System.out.println("Output of a>=b :" +" "+ (a>=b));
      System.out.println("Output of a<b :" +" "+ (a<b));
      System.out.println("Output of a<=b :" +" "+ (a<=b));
      System.out.println("Output of a!=b :" +" "+ (a!=b));
	}

}
